- input: "TEXT\x1CC00477182\x1C.TEXT\x1C\x1CF3N\x1CI.   The committee wishes to informally
    report, as arguably in-kind contributions, the costs of notarization of all but
    two pages of candidate's nominating papers, which occurred between July 20, 2010
    and August 1, 2010, totalling at $ 672.00.   Having not reimbursed these costs,
    the committee reserves the right to request treatment of these costs under the
    sections regarding questionable contributions and possibly illegal contributions.
    \    The committee believes moreso that the costs  fall outside of the scope of
    in-kind contributions, because they are not a charge made on the committee's behalf
    or made by a person in cooperation, consultation or concert with, or at the committee's
    or candidate's request or suggestion.   Also, existence of the costs in a report
    \ would have deeply affected the election in a way fraudulent and libelous, and
    in all likelihood irreversibly.     The circumstances caused the costs to be contested
    between the committee and individuals who paid the charges, allegedly  for surreptitious
    reasons.   Declaration of the costs in a report also stood likely of affecting
    future litigation.                        II.  The delay of 1 day for this report
    is caused by an overt breakdown of treasurer's and the committee's computer on
    November 30 and December 1, 2010, followed by a severe shortfall of treasurer's
    and the committee's internet availability on December 2 and December 3, 2010.\n"
